import './Map.css';
import React, { useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup, useMapEvents } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import L from 'leaflet';
import logo from './img/cow.png';
import { useNavigate } from 'react-router-dom';

let markerPlaced = false;

// Fix Leaflet's default icon issue
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

function AddMarker({ markers, setMarkers }) {
  useMapEvents({
    click(e) {
      const newMarker = e.latlng;
      setMarkers([...markers, newMarker]);
      markerPlaced = true;
    },
  });

  return (
    <>
      {markers.map((position, idx) => (
        <Marker key={idx} position={position}>
          <Popup><b>Crop location(30.42, 120.48)</b></Popup>
        </Marker>
      ))}
    </>
  );
}

const USDA_API_KEY = 'OmoJkEfgaSoRuKzNOoZvOpBgiIeZhTT1wnlnbyQb'; 

function CropPreference() {
  const [text, setText] = useState('What crops are you growing?');
  const [cropData, setCropData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchCropData = async (cropName) => {
    setLoading(true);
    setError(null);
    try {
      const response = await fetch(
        `https://api.nal.usda.gov/plants/v1/species?q=${cropName}&requireTaxonomy=true&api_key=${USDA_API_KEY}`
      );
      
      if (!response.ok) {
        throw new Error('Failed to fetch crop data');
      }

      const data = await response.json();
    
      if (data.data && data.data.length > 0) {
        const cropInfo = data.data[0];
        setCropData({
          scientificName: cropInfo.scientificName,
          commonName: cropInfo.commonName,
          moisture: cropInfo.growthRequirements?.moisture || 'Data not available',
          temperature: cropInfo.growthRequirements?.temperature || 'Data not available'
        });
      } else {
        setError('No data found for this crop');
      }
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  const handleClick = () => {
    if (text === "What crops are you growing?") {
      setText('');
    }
  };

  const handleChange = (e) => {
    const newText = e.target.value;
    setText(newText);
  };

  const handleSubmit = () => {
    if (text && text !== "What crops are you growing?") {
      fetchCropData(text.toLowerCase().trim());
    }
  };

  return (
    <div className="preferences flex">
      <div className="input-container">
        <textarea
          className="input cursor"
          value={text}
          onClick={handleClick}
          onChange={handleChange}
        />
        <button 
          onClick={handleSubmit}
          className="submit-button"
          disabled={loading || text === "What crops are you growing?"}
        >
          {loading ? 'Loading...' : 'Get Crop Data'}
        </button>
      </div>

      {error && (
        <div className="error-message">
          {error}
        </div>
      )}

      {loading && (
        <div className="loading">
          Loading crop data...
        </div>
      )}

      {cropData && !loading && !error && (
        <table className="table padding">
          <thead>
            <tr>
              <th>Property</th>
              <th>Value</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Common Name</td>
              <td>{cropData.commonName}</td>
            </tr>
            <tr>
              <td>Scientific Name</td>
              <td>{cropData.scientificName}</td>
            </tr>
            <tr>
              <td>Moisture Requirements</td>
              <td>{cropData.moisture}</td>
            </tr>
            <tr>
              <td>Temperature Requirements</td>
              <td>{cropData.temperature}</td>
            </tr>
          </tbody>
        </table>
      )}
    </div>
  );
}

function SoilData() {
  return (
    <>
    {markerPlaced && (
        <table className="table padding">
            <thead>
                <tr>
                    <th>Current Soil Moisture</th>
                    <th>Ph</th>
                    <th>Temperature</th>
                </tr>
            </thead>
        <tbody>
            <tr>
                <td>0.2</td>
                <td>8.6</td>
                <td>66-76F</td>
            </tr>
        </tbody>
        </table>
    )}
    </>
  );
}

function Map() {
  const navigate = useNavigate();
  const [markers, setMarkers] = useState([]);
  const [userLocation, setUserLocation] = useState([33.91, -118.41]);

  const goToListing = () => navigate('/listing');
  const goHome = () => navigate('/home');

  return (
    <>
      <nav className="navbar">
        <a href="#" className="logo-container" onClick={goHome}>
          <img className="cow" src={logo} alt="logo" />
          <span className="logo-text text">AlienExpress</span>
        </a>
        <div className="nav-links">
          <a href="index.html" className="text cursor">Desktop App</a>
          <a className="text cursor">Location Selection</a>
          <a onClick={goToListing} className="text cursor">Resource Shop</a>
        </div>
      </nav>
      <div className="top elementContainer">
        <p className="instruction h1 floating">Step 2: Set your preferences</p>
      </div>
      <div className="columnContainer">
        <div className="leftColumn">
          <div className="mapContainer">
            <MapContainer center={userLocation} zoom={13} id="map">
              <TileLayer
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                attribution='&copy; <a href="https://osm.org/copyright">OpenStreetMap</a> contributors'
              />
              <Marker position={userLocation}>
                <Popup>
                  <b>Your location (33.91, -118.41)</b>
                </Popup>
              </Marker>
              <AddMarker markers={markers} setMarkers={setMarkers} />
            </MapContainer>
          </div>
        </div>
        <div className="right-column">
          <SoilData />
          <CropPreference />
        </div>
      </div>
    </>
  );
}

export default Map;
